    false,nt"url": null,nt"notes": "This part of the Oregon OCS Data Release
    presents marine mammal observations from U.S. Geological Survey (USGS) field activity
    2014-607-FA in the Oregon Outer continental Shelf (OCS)Floating Wind Farm survey
    area. The survey was conducted using 12 hour day operations out of Charleston Harbor
    near Coos Bay, Oregon. The cruise plan consisted of 23 days on site split between
    sonar mapping and video ground truth surveying. Activities parsed out to nine days
    of sonar mapping, three days of video surveying, eight days of no operations due
    to weather, and three days mobilizing and demobilizing (table 1). Typically the
    Snavely would transit out to the survey area in an hour at a speed of 20 knots.
    Marine Mammal observations were made during the multibeam sonar mapping portion
    of the cruise only. Multibeam sonar operations were conducted on north or south
    oriented tracklines at a speed of 4 to 5 knots depending on sea state. Observations
    were also made on the transit out to the Floating Windfarm site.",nt"license_title":
